import { Switch, Route } from 'react-router-dom';

const Content = () => (
  <Switch>
    <Route exact path="/page-1" component={() => <span>Pages</span>} />
    <Route exact path="/page-2" component={() => <span>News</span>} />
    <Route exact path="/flashes" component={() => <span>Flashes</span>} />
    <Route exact path="/magazines" component={() => <span>Magazines</span>} />
    <Route exact path="/fields" component={() => <span>Fields</span>} />
    <Route
      exact
      path="/medialibrary"
      component={() => <span>Media Library</span>}
    />
  </Switch>
);

export default Content;
